package Assignment;

public class printing14 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
             
		int n=7;
		int a=0;
		
		for(int i=2;i<n;i++)
		{
			if(n%i==0)
			{
				a++;
				break;
			}}
		if(a>0)	
			System.out.println("Given numebrs is not prime number");
		else
			System.out.println("Given number is prime number");
			
			
		
		
		
		
	}

}
